import React from 'react';

function Signup() {

    const handleSignup = async (e) => {
        e.preventDefault();
        const formData = {
            name: document.getElementById("name"),
            email: document.getElementById("email"),
            password: document.getElementById("password"),
        };

        const res = await fetch('http://localhost:3000/signup', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify(formData),
        });

        const result = await res.json();
        console.log(result);
    }

    return (
        <>
            <div className=' mt-5 mb-5 pb-5 w-50 container border-black'>
                <form onSubmit={handleSignup} className=' mt-5 vh-100'>
                    <div class="mb-3">
                        <label for="name" class="form-label">Name</label>
                        <input type="text" class="form-control" id="name" required></input>
                    </div>
                    <div class="mb-3">
                        <label for="email" class="form-label">Email address</label>
                        <input type="email" class="form-control" id="email" aria-describedby="email" required></input>
                        <div id="email" class="form-text">We'll never share your email with anyone else.</div>
                    </div>
                    <div class="mb-3">
                        <label for="password" class="form-label">Password</label>
                        <input type="password" class="form-control" id="password" required></input>
                    </div>
                    <div class="mb-3 form-check">
                        <input type="checkbox" class="form-check-input" id="checkbox" required></input>
                        <label class="form-check-label" for="checkbox">Check me out</label>
                    </div>
                    <button type="submit" class="btn btn-primary">Submit</button>
                </form>
            </div>
        </>
    );
}

export default Signup;
